import './App.css';
import NameCard from './NameCard'
import './style.css'

function App() {
  var name = '김민욱-Wookie'
  return (
    <div className="App">
      <div className="container">
      <NameCard name={name}/>
      </div>
    </div>
  );
}

export default App;
